import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  main: {
    backgroundColor: 'white',
  },
  container: {
    backgroundColor: 'lightblue',
  },
  buttons: {
    marginTop: '40px',
    alignSelf: 'center',
    color: 'main',
  },
}))

export default useStyles;
